var tipuesearch = {"pages": [{'title': 'First', 'text': '', 'tags': '', 'url': 'First.html'}, {'title': 'about', 'text': '', 'tags': '', 'url': 'about.html'}, {'title': 'vocabulary', 'text': 'The_Oxford_5000.pdf \n cambridge_english_vocabulary_list.pdf \n', 'tags': '', 'url': 'vocabulary.html'}, {'title': 'GPT', 'text': 'Q:轉動慣量的公式 \n A: 轉動慣量（也稱為慣性矩）是描述物體繞著軸旋轉時對旋轉運動的抵抗程度的物理量。不同形狀的物體其轉動慣量的計算公式不同，以下是一些常見形狀物體的轉動慣量公式： \n \n \n 點狀物體（質點）： 對於質點，其轉動慣量為零，因為點狀物體在旋轉時並無具體的形狀和尺寸。 \n \n \n 直線棒（長度為L，質量為m，繞著一端垂直軸旋轉）： 轉動慣量的公式為：I = (1/3)mL^2 \n \n \n 環狀物體（內半徑為r1，外半徑為r2，質量為m）： 轉動慣量的公式為：I = (1/2)m(r1^2 + r2^2) \n \n \n 球體（半徑為r，質量為m）： 轉動慣量的公式為：I = (2/5)m*r^2 \n \n \n 薄板（長度為L，寬度為w，質量為m，繞著平行於寬度軸旋轉）： 轉動慣量的公式為：I = (1/3)mL^2 \n \n \n 以上僅為一些常見形狀物體的轉動慣量公式，實際應用中可能還有其他形狀物體的轉動慣量需要使用不同的公式計算。注意，不同教材和文獻可能會使用不同的符號和單位來表示轉動慣量，使用時應留意公式的表達形式和單位的一致性。 \n \n', 'tags': '', 'url': 'GPT.html'}, {'title': '0.0', 'text': '0 \n', 'tags': '', 'url': '0.0.html'}]};